d the third most are iPhone and Wired Headphones 722 orders.\n","\n","- The probability of customers ordering specific products compared to all other products was calculated as following: \n","       * USB-C Charging Cable: 11.77% \n","       * iPhone: 3.67% \n","       * Google Phone: 2.97% \n","       * Wired Headphones: 10.15%"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":20.328559,"end_time":"2023-04-28T10:58:44.933782","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-04-28T10:58:24.605223","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}